import random
import string
import datetime as dt
#import time

## POSSIBLE VALUES

# origins/destinations
locs = ["Yale", "Airport-JFK", "Airport-LGA", "Airport-EWR", "Airport-BDL", "Airport-BOS", "Airport-HVN", "TrainStation-UnionStationNHV", "TrainStation-PennStationNYC"]

# group sizes
sm = 2 #smallest possible group size
la = 5 #largest possible group size
group_sizes = [str(i) for i in (range(sm,la))]

# car types
car_types = ['Regular', 'XL']

def gen_random_datetime():
    #date
    y = random.randrange(dt.datetime.min.year, dt.datetime.max.year)
    mo = random.randrange(1, 12)
    last_day = int((dt.date(y,mo+1,1)-dt.timedelta(days=1)).day)+1 #calculate the last day of the month
    d = random.randrange(1, last_day)

    #time
    h = random.randrange(0, 24)
    mi = random.randrange(0, 60)
    s = random.randrange(0, 60)

    return dt.datetime(y,mo,d,h,mi,s)

#src: https://stackoverflow.com/questions/553303/generate-a-random-date-between-two-other-dates
def random_dt_in_range(start, end):
    """
    This function will return a random datetime between two datetime 
    objects.
    """
    delta = end - start
    int_delta = int(delta.total_seconds())
    if int_delta == 0:
        return start
    else:
        random_second = random.randrange(int_delta)
        return start + dt.timedelta(seconds=random_second)

def gen_request(req_id, date_range_start, date_range_end, orig=None, dest=None, matched=0.5):
    ''' Generates a single random/pseudorandom request within the date range with id used for requestId'''
    req = {}

    #netId
    req['netId'] = ''.join(random.choice(string.ascii_lowercase) for i in range(3)) + ''.join(random.choice(string.digits) for j in range(2)) 
    
    #departure date
    departure_datetime = random_dt_in_range(date_range_start, date_range_end)
    req['date'] = departure_datetime.strftime('%Y-%m-%d')

    #origin and destination
    tmp = list(locs)
    if orig:
        if not dest:
            tmp.remove(orig) #remove orig from dest choices
            dest = random.choice(tmp) #choose dest
    else:
        if not dest:
            dest = random.choice(tmp) #choose dest
        tmp.remove(dest) #remove dest from orig choices
        orig = random.choice(tmp) #choose orig

    req['origin'] = orig
    req['destination'] = dest

    # groupId and matched
    r = random.random()
    if r < matched : #matched
        req['groupId'] = 'TEST-UUID'
        req['matched'] = True
    else: #unmatched
        req['groupId'] = ''
        req['matched'] = False
    
    #group size and car type preferences
    req['preferred_car_type'] = random.choice(car_types)
    req['preferred_group_size'] = random.choice(group_sizes)
    
    #requestId
    req['requestId'] = f"this-is-a-test-req-id-{req_id}"

    #request time
    #choose a random time before departure
    req_datetime = random_dt_in_range(date_range_start, departure_datetime)
    req['request_time'] = req_datetime.strftime('%Y-%m-%d %H:%M:%S')
        
    #departure time
    req['time'] = departure_datetime.strftime('%H:%M')

    return req

def gen_sample_input(n, s, e, sparsity=None, orig=None, dest=None, matched=0.5):
    ''' Returns a list of random or pseudorandom requests. 
    N is an integer that determines the number of requests to generate/the length of the returned list.

    S is a datetime.day value representing the start of the date range and E is a datetime.day values representing
    the end of the date range the request may be in. 

    If SPARSITY is defined, all requests will be within the given time range of each other. A random date within S and
    E will be chosen as the new start of the range and SPARSITY will be added to that value to get the end of the range. 
    This may mean  that some requests will be outside of the date range defined by S and E, especially if the given 
    sparsity is larger than the range between S and E. SPARSITY may be a custom datetime.timedelta value. Otherwise, 
    SPARSITY will be interpreted as an integer value representing number of weeks.

    If ORIG and DEST are not defined, the requests will have origins and destinations randomly chosen from locs, 
    a list of possible locations. Otherwise, the request will use the defined ORIGIN and DESTINATION.

    MATCHED is a float value that represents the proportion of requests that will have a default 'matched' 
    configuration. If MATCHED is None, this value will be 0.5 by default.'''

    inp = []

    
    start = dt.datetime.combine(s, dt.time.min) #start of date range
    end =  dt.datetime.combine(e, dt.time.max) #end of date range

    if sparsity:
        if type(sparsity) is not dt.timedelta:
            sparsity = dt.timedelta(weeks=int(sparsity))
        start = random_dt_in_range(start,end) #pick random start date in range
        end = start + sparsity #add timedelta to start
    
    for i in range(n):
        req = gen_request(i, start, end, orig, dest, matched)
        inp.append(req)

    return inp


